import React from 'react';
import './App.css';
import CalculatorPage from './components/CalculatorPage';
import CharactersPage from './components/CharactersPage';
import ClassesPage from './components/ClassesPage';
import { createBrowserRouter, createRoutesFromElements, Route, RouterProvider } from 'react-router-dom';
import Root from './Root';

const router = createBrowserRouter(createRoutesFromElements(
	<Route path="" element={<Root />}>
		<Route path={`${process.env.PUBLIC_URL}/calculator`} element={<CalculatorPage />}/>
		<Route path={`${process.env.PUBLIC_URL}/characters`} element={<CharactersPage />}/>
		<Route path={`${process.env.PUBLIC_URL}/classes`} element={<ClassesPage />}/>
	</Route>
), {basename: "/engage-growths"})

function App() {
  	return (
    	<RouterProvider router={router} />
  	);
}

export default App;
